import CloseIcon from "@material-ui/icons/Close";
import HomeComp from "../components/HomeComp";

function Home() {
  return (
    <div>
      <HomeComp
        imageSrc="https://www.fbdhotels.com/cmsGallery/imagerow/12623/resized/1600x900/sunset_banner.jpg"
        altName="hotel-beach"
        heading1="Explore"
      />
      <HomeComp
        imageSrc="https://cdn.suwalls.com/wallpapers/beaches/palawan-island-resort-philippines-28615-1920x1080.jpg"
        altName="hotel-beach"
        heading1="Delight"
        heading2="in every bite"
      />
      <HomeComp
        imageSrc="https://cdn.suwalls.com/wallpapers/beaches/palawan-island-resort-philippines-28615-1920x1080.jpg"
        altName="hotel-beach"
        heading1="Enjoy"
        heading2="Your Stay"
      />
    </div>
  );
}

export default Home;
